import{_ as a}from"./chunks/position_fixed.t2m3lWVy.js";import{_ as r}from"./chunks/acceptance_radius_mission.CoN1pDbl.js";import{_ as t,c as l,a8 as _,o as i}from"./chunks/framework.BDnHobkS.js";const d=JSON.parse('{"title":"Режим місії (Мультикоптер)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_modes_mc/mission.md","filePath":"uk/flight_modes_mc/mission.md"}'),o={name:"uk/flight_modes_mc/mission.md"};function n(s,e,m,h,M,A){return i(),l("div",null,e[0]||(e[0]=[_('<h1 id="режим-місіі-мультикоптер" tabindex="-1">Режим місії (Мультикоптер) <a class="header-anchor" href="#режим-місіі-мультикоптер" aria-label="Permalink to &quot;Режим місії (Мультикоптер)&quot;">​</a></h1><img src="'+a+'" title="Global position fix required (e.g. GPS)" width="30px"><p><em>Режим місії</em> змушує транспортний засіб виконувати передбачений автономний <a href="./../flying/missions.html">план місії</a> (план польоту), який був завантажений до керуючого пристрою польоту. Зазвичай місія створюється та завантажується за допомогою програми для керування наземною станцією (GCS), такої як <a href="https://docs.qgroundcontrol.com/master/en/" target="_blank" rel="noreferrer">QGroundControl</a> (QGC).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Цей режим потребує глобальної оцінки 3D-позиції (з GPS або виведеної з <a href="./../ros/external_position_estimation.html#enabling-auto-modes-with-a-local-position">локальної позиції</a>).</li><li>Транспортний засіб повинен бути озброєний перед тим, як цей режим може бути активований.</li><li>Цей режим є автоматичним - для керування автомобілем не потрібно втручання користувача.</li><li>Перемикачі керування RC можуть використовуватися для зміни режимів польоту на будь-якому транспортному засобі.</li><li>Рух палиць дистанційного керування буде <a href="#COM_RC_OVERRIDE">за замовчуванням</a> змінювати транспортний засіб на <a href="./../flight_modes_mc/position.html">режим позиції</a>, якщо не виникне критична аварія батареї. Це справжнє для багтороторів і ВПС у режимі КУ.</li></ul></div><h2 id="опис" tabindex="-1">Опис <a class="header-anchor" href="#опис" aria-label="Permalink to &quot;Опис&quot;">​</a></h2><p>Місії зазвичай створюються в земній контрольній станції (наприклад, <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/plan_view/plan_view.html" target="_blank" rel="noreferrer">QGroundControl</a>) та завантажуються перед запуском. Вони також можуть бути створені за допомогою розробника API або завантажені під час польоту.</p><p>Індивідуальні <a href="#mission-commands">команди місії</a> обробляються таким чином, який є відповідним для характеристик багтороторного польоту (наприклад, обертання виконується у вигляді <em>залишання на місці</em>).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Місії завантажуються на SD-карту, яку потрібно вставити <strong>перед</strong> запуском автопілота.</p></div><p>На високому рівні всі типи транспортних засобів ведуть себе однаково, коли ввімкнено режим МІСІЯ:</p><ol><li><p>Якщо місія не збережена, або якщо PX4 завершив виконання всіх команд місії, або якщо <a href="#mission-feasibility-checks">місія не є можливою</a>:</p><ul><li>Якщо літає транспортний засіб, він буде утримувати.</li><li>Якщо посадять транспортний засіб, він буде &quot;чекати&quot;.</li></ul></li><li><p>Якщо місія збережена, а PX4 летить, вона виконає <a href="./../flying/missions.html">місію / план польоту</a> з поточного кроку.</p><ul><li>Пункт <code>TAKEOFF</code> трактується як звичайна точка місії.</li></ul></li><li><p>Якщо місія збережена і PX4 приземлився:</p><ul><li>PX4 виконає <a href="./../flying/missions.html">місію/план польоту</a>.</li><li>Якщо місія не має пункту <code>TAKEOFF</code>, то PX4 підніме транспортний засіб на мінімальну висоту перед виконанням решти польотного плану з поточного кроку.</li></ul></li><li><p>Якщо жодне завдання не збережено, або якщо PX4 завершив виконання всіх команд місії:</p><ul><li>Якщо літає транспортний засіб, він буде утримувати.</li><li>Якщо посадять транспортний засіб, він буде &quot;чекати&quot;.</li></ul></li><li><p>Ви можете вручну змінити поточну команду місії, вибравши її в <em>QGroundControl</em>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Якщо у вас є команда <em>Перейти до елементу</em> в місії, переміщення до іншого елементу <strong>не</strong> скине лічильник циклу. Однією з наслідків є те, що якщо ви зміните поточну команду місії на 1, це не призведе до &quot;повного перезапуску&quot; місії.</p></div></li></ol><p>:::</p><ol start="6"><li><p>Місія скине тільки тоді, коли транспортний засіб буде роззброєний або коли буде завантажена нова місія.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Щоб автоматично роззброїти транспортний засіб після посадки, у <em>QGroundControl</em> перейдіть до <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/setup_view/safety.html" target="_blank" rel="noreferrer">Налаштування Транспортного Засобу &gt; Безпека</a>, перейдіть до <em>Налаштувань Режиму Посадки</em> та позначте прапорець <em>Роззброювати після</em>. Введіть час очікування після посадки перед відброюванням транспортного засобу.</p></div></li></ol><p>:::</p><p>Місії можна призупинити, переключившись з режиму місії на будь-який інший режим (наприклад, <a href="./../flight_modes_mc/hold.html">режим утримання</a> або <a href="./../flight_modes_mc/position.html">режим позиціонування</a>), і продовжити, переключившись назад в режим місії. Якщо транспортний засіб не захоплював зображення, коли він був призупинений, під час відновлення він рухатиметься зі своєї <em>поточної позиції</em> до тієї ж точки шляху, до якої він спочатку рухався. Якщо транспортний засіб захоплював зображення (має елементи спуску камери), він замість цього рухатиметься зі своєї поточної позиції до останньої точки шляху, якою він проїхав (перед зупинкою), а потім пройде свій шлях з тією самою швидкістю та з такою самою поведінкою спуску камери. Це забезпечує, що планований шлях зафіксований під час місій з опитування/камери. Місію можна завантажити, коли транспортний засіб зупинений, у такому випадку поточний активний елемент місії встановлюється на 1.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Коли місію призупинено під час спрацювання камери на транспортному засобі, PX4 встановлює поточний активний пункт місії на попередню точку маршруту, так що при відновленні місії транспортний засіб буде повторювати свій останній етап місії. Крім того, PX4 зберігає останні застосовані пункти місії для налаштування швидкості та спуску камери (з вже покритого плану місії) та знову застосовує ці налаштування при відновленні місії.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Переконайтеся, що палиця регулювання газу не дорівнює нулю перед переключенням в будь-який режим RC (інакше транспортний засіб розбився). Ми рекомендуємо вам вирівнювати ручки керування перед переходом до будь-якого іншого режиму.</p></div><p>Для отримання додаткової інформації про планування місії, див:</p><ul><li><a href="./../flying/missions.html">Планування місій</a></li><li><a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/plan_view/plan_view.html" target="_blank" rel="noreferrer">План Перегляду</a> (<em>Посібник користувача QGroundControl</em>)</li></ul><h2 id="перевірки-можливостеи-місіі" tabindex="-1">Перевірки можливостей місії <a class="header-anchor" href="#перевірки-можливостеи-місіі" aria-label="Permalink to &quot;Перевірки можливостей місії&quot;">​</a></h2><p>PX4 runs some basic sanity checks to determine if a mission is feasible when it is uploaded and before executing a mission. If any of the checks fail, the user is notified and it is not possible to start the mission (the vehicle will switch to <a href="./../flight_modes_mc/hold.html">Hold mode</a> instead of Mission mode).</p><p>Підмножина найважливіших перевірок перерахована нижче:</p><ul><li>Будь-який елемент місії конфліктує з планом або безпечним геозахистом</li><li>Відсутній пункт зльоту та/або посадки, коли вони налаштовані як вимога (<a href="#MIS_TKO_LAND_REQ">MIS_TKO_LAND_REQ</a>)</li></ul><p>Additionally there is a check if the first waypoint is too far from the Home position (<a href="#MIS_DIST_1WP">MIS_DIST_1WP</a>). The user is notified should the check fail, but it has no effect on the validity of a mission plan, meaning that the mission can still be started even if the distance is too high.</p><h2 id="qgroundcontrol-підтримка" tabindex="-1">QGroundControl Підтримка <a class="header-anchor" href="#qgroundcontrol-підтримка" aria-label="Permalink to &quot;QGroundControl Підтримка&quot;">​</a></h2><p><em>QGroundControl</em> надає додаткову підтримку обробки місій на рівні GCS (на додачу до того, що надає контролер польоту).</p><p>Для додаткової інформації дивіться:</p><ul><li><a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/releases/stable_v3.2_long.html#remove-mission-after-vehicle-lands" target="_blank" rel="noreferrer">Видалити місію після посадки транспортного засобу</a></li><li><a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/releases/stable_v3.2_long.html#resume-mission" target="_blank" rel="noreferrer">Відновити місію після режиму Повернення</a></li></ul><h2 id="параметри-місіі" tabindex="-1">Параметри місії <a class="header-anchor" href="#параметри-місіі" aria-label="Permalink to &quot;Параметри місії&quot;">​</a></h2><p>Поведінка місій залежить від ряду параметрів, більшість з яких задокументовані в <a href="./../advanced_config/parameter_reference.html#mission">Довідник параметрів &gt; Місія</a>. Дуже маленька підмножина наведені нижче.</p><p>Загальні параметри:</p><table tabindex="0"><thead><tr><th>Параметр</th><th>Опис</th></tr></thead><tbody><tr><td><a id="NAV_RCL_ACT"></a><a href="./../advanced_config/parameter_reference.html#NAV_RCL_ACT">NAV_RCL_ACT</a></td><td>Режим аварійного відновлення зв&#39;язку RC (що робить транспортний засіб, якщо втрачає зв&#39;язок RC) - наприклад, увійти в режим утримання, режим повернення, завершити тощо.</td></tr><tr><td><a id="COM_RC_OVERRIDE"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a></td><td>Контролює переміщення джойстика на мультикоптері (або конвертоплані у режимі MC) повертає керування пілоту в <a href="./../flight_modes_mc/position.html">Режим положення</a>. Це можна окремо увімкнути для автоматичних режимів та для режиму поза бортом, і в автоматичних режимах воно включено за замовчуванням.</td></tr><tr><td><a id="COM_RC_STICK_OV"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_STICK_OV">COM_RC_STICK_OV</a></td><td>Кількість рухів стиків, яка викликає перехід у <a href="./../flight_modes_mc/position.html">режим Положення</a> (якщо <a href="#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a> увімкнено).</td></tr></tbody></table><p>Параметри, пов&#39;язані з <a href="#mission-feasibility-checks">перевірками можливостей місії</a>:</p><table tabindex="0"><thead><tr><th>Параметр</th><th>Опис</th></tr></thead><tbody><tr><td><a id="MIS_DIST_1WP"></a><a href="./../advanced_config/parameter_reference.html#MIS_DIST_1WP">MIS_DIST_1WP</a></td><td>There is a warning message if the distance of the first waypoint to Home is more than this value. Вимкнено, якщо значення дорівнює 0 або менше.</td></tr><tr><td><a id="FW_LND_ANG"></a><a href="./../advanced_config/parameter_reference.html#FW_LND_ANG">FW_LND_ANG</a></td><td>Максимальний кут нахилу підйому.</td></tr><tr><td><a id="MIS_TKO_LAND_REQ"></a><a href="./../advanced_config/parameter_reference.html#MIS_TKO_LAND_REQ">MIS_TKO_LAND_REQ</a></td><td>Sets whether mission <em>requires</em> takeoff and/or landing items. No requirement by default for multicopter.</td></tr></tbody></table><h2 id="mission_commands" tabindex="-1">Mission Commands <a class="header-anchor" href="#mission_commands" aria-label="Permalink to &quot;Mission Commands {#mission_commands}&quot;">​</a></h2><p>PX4 &quot;приймає&quot; наступні команди місії MAVLink у режимі Місії (з деякими <em>попередженнями</em>, які наведені після списку). Якщо не вказано інше, реалізація відповідає визначенню у специфікації MAVLink.</p><p>Предмети місії:</p><ul><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_WAYPOINT" target="_blank" rel="noreferrer">MAV_CMD_NAV_WAYPOINT</a><ul><li><em>Param3</em> (проліт) ігнорується. Flythrough завжди ввімкнено, якщо <em>param 1</em> (time_inside) &gt; 0.</li></ul></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LOITER_UNLIM" target="_blank" rel="noreferrer">MAV_CMD_NAV_LOITER_UNLIM</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LOITER_TIME" target="_blank" rel="noreferrer">MAV_CMD_NAV_LOITER_TIME</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_LAND</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_TAKEOFF" target="_blank" rel="noreferrer">MAV_CMD_NAV_TAKEOFF</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LOITER_TO_ALT" target="_blank" rel="noreferrer">MAV_CMD_NAV_LOITER_TO_ALT</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_JUMP" target="_blank" rel="noreferrer">MAV_CMD_DO_JUMP</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_ROI" target="_blank" rel="noreferrer">MAV_CMD_NAV_ROI</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_SET_ROI" target="_blank" rel="noreferrer">MAV_CMD_DO_SET_ROI</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_SET_ROI_LOCATION" target="_blank" rel="noreferrer">MAV_CMD_DO_SET_ROI_LOCATION</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_SET_ROI_WPNEXT_OFFSET" target="_blank" rel="noreferrer">MAV_CMD_DO_SET_ROI_WPNEXT_OFFSET</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_SET_ROI_NONE" target="_blank" rel="noreferrer">MAV_CMD_DO_SET_ROI_NONE</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_CHANGE_SPEED" target="_blank" rel="noreferrer">MAV_CMD_DO_CHANGE_SPEED</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_SET_HOME" target="_blank" rel="noreferrer">MAV_CMD_DO_SET_HOME</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_SET_SERVO" target="_blank" rel="noreferrer">MAV_CMD_DO_SET_SERVO</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_LAND_START" target="_blank" rel="noreferrer">MAV_CMD_DO_LAND_START</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_TRIGGER_CONTROL" target="_blank" rel="noreferrer">MAV_CMD_DO_TRIGGER_CONTROL</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_DIGICAM_CONTROL" target="_blank" rel="noreferrer">MAV_CMD_DO_DIGICAM_CONTROL</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_MOUNT_CONFIGURE" target="_blank" rel="noreferrer">MAV_CMD_DO_MOUNT_CONFIGURE</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_MOUNT_CONTROL" target="_blank" rel="noreferrer">MAV_CMD_DO_MOUNT_CONTROL</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_IMAGE_START_CAPTURE" target="_blank" rel="noreferrer">MAV_CMD_IMAGE_START_CAPTURE</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_IMAGE_STOP_CAPTURE" target="_blank" rel="noreferrer">MAV_CMD_IMAGE_STOP_CAPTURE</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_VIDEO_START_CAPTURE" target="_blank" rel="noreferrer">MAV_CMD_VIDEO_START_CAPTURE</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_VIDEO_STOP_CAPTURE" target="_blank" rel="noreferrer">MAV_CMD_VIDEO_STOP_CAPTURE</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_SET_CAM_TRIGG_DIST" target="_blank" rel="noreferrer">MAV_CMD_DO_SET_CAM_TRIGG_DIST</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_SET_CAM_TRIGG_INTERVAL" target="_blank" rel="noreferrer">MAV_CMD_DO_SET_CAM_TRIGG_INTERVAL</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_SET_CAMERA_MODE" target="_blank" rel="noreferrer">MAV_CMD_SET_CAMERA_MODE</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_DELAY" target="_blank" rel="noreferrer">MAV_CMD_NAV_DELAY</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_RETURN_TO_LAUNCH" target="_blank" rel="noreferrer">MAV_CMD_NAV_RETURN_TO_LAUNCH</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_CONTROL_VIDEO" target="_blank" rel="noreferrer">MAV_CMD_DO_CONTROL_VIDEO</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_GIMBAL_MANAGER_PITCHYAW" target="_blank" rel="noreferrer">MAV_CMD_DO_GIMBAL_MANAGER_PITCHYAW</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_GIMBAL_MANAGER_CONFIGURE" target="_blank" rel="noreferrer">MAV_CMD_DO_GIMBAL_MANAGER_CONFIGURE</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_OBLIQUE_SURVEY" target="_blank" rel="noreferrer">MAV_CMD_OBLIQUE_SURVEY</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_SET_CAMERA_ZOOM" target="_blank" rel="noreferrer">MAV_CMD_SET_CAMERA_ZOOM</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_SET_CAMERA_FOCUS" target="_blank" rel="noreferrer">MAV_CMD_SET_CAMERA_FOCUS</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_VTOL_TAKEOFF" target="_blank" rel="noreferrer">MAV_CMD_NAV_VTOL_TAKEOFF</a><ul><li><code>MAV_CMD_NAV_VTOL_TAKEOFF.param2</code> (заголовок переходу) ігнорується. Замість цього напрямок до наступної маршрутної точки використовується для переходу. </li></ul></li></ul><p>Визначення GeoFence</p><ul><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_FENCE_RETURN_POINT" target="_blank" rel="noreferrer">MAV_CMD_NAV_FENCE_RETURN_POINT</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_FENCE_POLYGON_VERTEX_INCLUSION" target="_blank" rel="noreferrer">MAV_CMD_NAV_FENCE_POLYGON_VERTEX_INCLUSION</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_FENCE_POLYGON_VERTEX_EXCLUSION" target="_blank" rel="noreferrer">MAV_CMD_NAV_FENCE_POLYGON_VERTEX_EXCLUSION</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_FENCE_CIRCLE_INCLUSION" target="_blank" rel="noreferrer">MAV_CMD_NAV_FENCE_CIRCLE_INCLUSION</a></li><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_FENCE_CIRCLE_EXCLUSION" target="_blank" rel="noreferrer">MAV_CMD_NAV_FENCE_CIRCLE_EXCLUSION</a></li></ul><p>Точки збору</p><ul><li><a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_RALLY_POINT" target="_blank" rel="noreferrer">MAV_CMD_NAV_RALLY_POINT</a></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Please add an issue report or PR if you find a missing/incorrect message.</p><ul><li>PX4 аналізує вищезазначені повідомлення, але на них не обов&#39;язково <em>реагує</em>. Наприклад, деякі повідомлення є специфічними для типу транспортного засобу.</li><li>PX4 не підтримує локальні координати для команд місій (наприклад, <a href="https://mavlink.io/en/messages/common.html#MAV_FRAME_LOCAL_NED" target="_blank" rel="noreferrer">MAV_FRAME_LOCAL_NED</a>).</li><li>Не всі повідомлення/команди доступні через <em>QGroundControl</em>.</li><li>Список може стати застарілим, оскільки додаються повідомлення. Ви можете перевірити поточний набір, оглянувши код. Підтримка - <code>MavlinkMissionManager::parse_mavlink_mission_item</code> у <a href="https://github.com/PX4/PX4-Autopilot/blob/main/src/modules/mavlink/mavlink_mission.cpp" target="_blank" rel="noreferrer">/src/modules/mavlink/mavlink_mission.cpp</a>.</li></ul></div><h2 id="закруглені-повороти-траєкторія-міжточкового-маршруту" tabindex="-1">Закруглені повороти: Траєкторія міжточкового маршруту <a class="header-anchor" href="#закруглені-повороти-траєкторія-міжточкового-маршруту" aria-label="Permalink to &quot;Закруглені повороти: Траєкторія міжточкового маршруту&quot;">​</a></h2><p>PX4 очікує пряму лінію від попередньої точки маршруту до поточної цілі (він не планує будь-якого іншого шляху між точками маршруту - якщо вам потрібен такий, ви можете симулювати це додаванням додаткових точок маршруту).</p><p>Технічні засоби керування MC будуть змінювати <em>швидкість</em> при наближенні або виходженні з точки відповідно до налаштувань <a href="./../config_mc/mc_jerk_limited_type_trajectory.html#auto-mode">обмеження ривків</a>. Транспортний засіб буде слідувати плавною округлою кривою до наступної точки шляху (якщо визначено) визначеною радіусом прийняття (<a href="./../advanced_config/parameter_reference.html#NAV_ACC_RAD">NAV_ACC_RAD</a>). Діаграма нижче показує види шляхів, які ви можете очікувати.</p><p><img src="'+r+'" alt="acc-rad"></p><p>Транспортні засоби переключаються на наступну точку шляху, як тільки вони потрапляють в радіус прийняття (<a href="./../advanced_config/parameter_reference.html#NAV_ACC_RAD">NAV_ACC_RAD</a>).</p><h2 id="місія-зліт" tabindex="-1">Місія зліт <a class="header-anchor" href="#місія-зліт" aria-label="Permalink to &quot;Місія зліт&quot;">​</a></h2><p>Заплануйте місію зльоту мультикоптера, додавши елемент місії <code>TAKEOFF</code> на карту (це відповідає <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_TAKEOFF" target="_blank" rel="noreferrer">MAV_CMD_NAV_TAKEOFF</a> команді MAVLink).</p><p>Під час виконання цієї місії транспортний засіб підніметься вертикально до мінімальної висоти взяття на озброєння, визначеної в параметрі <a href="./../advanced_config/parameter_reference.html#MIS_TAKEOFF_ALT">MIS_TAKEOFF_ALT</a>, а потім рушить у напрямку 3D-позиції, визначеної у елементі місії.</p><p>Якщо місія без виконання завдань стартує, транспортний засіб підійде на мінімальну висоту взльоту, а потім перейде до першого елементу місії <code>Waypoint</code>.</p><p>Якщо транспортний засіб вже знаходиться в повітрі під час початку місії, місія зльоту розглядається як звичайний точка шляху.</p><h2 id="дивіться-також" tabindex="-1">Дивіться також <a class="header-anchor" href="#дивіться-також" aria-label="Permalink to &quot;Дивіться також&quot;">​</a></h2><ul><li><a href="./../flying/missions.html">Місії</a><ul><li><a href="./../flying/package_delivery_mission.html">Місія доставки посилок</a></li></ul></li><li><a href="./../flight_modes_fw/mission.html">Режим Місії (FW)</a></li></ul>',54)]))}const p=t(o,[["render",n]]);export{d as __pageData,p as default};
